        /****************************************************************************
            @PURPOSE      : file number creation
            @PARAMETERS   : form,formdata
            @RETURN       : NA
         ****************************************************************************/
        this.submitted = false;
        this.isFileCreated = false;
        this.showData = false;
        /****************************************************************************/
        this.isExp = false;
        /****************************************************************************/
        this.disableButton = false;
        this.fileApplications = [];
        this.iseditHeader = false;
        this.isedit = false;
